// Setup multer to handle file uploads
const storage = multer.diskStorage({
  destination: (req, file, cb) => {
    cb(null, 'tmp/');  // Define where to save the uploaded file
  },
  filename: (req, file, cb) => {
    cb(null, Date.now() + path.extname(file.originalname));  // Rename file with timestamp to avoid duplicates
  }
});

const upload = multer({ storage: storage });

// Endpoint for file upload
app.post('/upload-excel', upload.single('file'), async (req, res) => {
  if (!req.file) {
    return res.status(400).send('No file uploaded');
  }

  try {
    const filePath = req.file.path;
    const fileData = fs.createReadStream(filePath);
    const form = new FormData();
    form.append('file', fileData, filePath);
    const formHeaders = form.getHeaders();
    const student = await uploadStudentData(form, formHeaders);

    // Delete the uploaded file after processing
    fs.unlink(filePath, (err) => {
      if (err) {
        console.error('Error deleting the uploaded file:', err);
      }
    });

    if (student.success) {
      res.status(student.status).send(JSON.stringify(student.data));
    } else {
      res.status(student.status).send(JSON.stringify(student.error));
    }
  } catch (error) {
    console.error('Error upload file::::', error);
    const resObj = {
      "message": "Error processing the file",
      "error": error
    }
    res.status(500).send(JSON.stringify(resObj));
  }
});

