app.get('/download-pdf/:studentId', async (req, res) => {
  // console.log("req.params::", req.params);
  const studentReportId = req.params.studentId;
  const student = await fetchStudentReport(studentReportId);
  // console.log("students data is coming::", student);
  // const student = students.find(s => s.studentReportId === studentReportId);

  if (!Object.keys(student).length) {
    return res.status(404).send('Student not found');
  }
  try {
    // Render HTML for the PDF using EJS template
    const htmlContent = await new Promise((resolve, reject) => {
      res.render('studentPdfTemplate', { student }, (err, html) => {
        if (err) reject(err);
        resolve(html);
      });
    });

    console.log("before browser install");

    // Launch Puppeteer to generate the PDF
    const browser = await puppeteer.launch({
      headless: 'new',
      timeout: 120000,
      args: [
        '--no-sandbox',
        '--disable-setuid-sandbox',
        '--disable-gpu',  // Disable GPU hardware acceleration
        '--disable-software-rasterizer', // Disable software rasterizer
        '--remote-debugging-port=9222', // Optional: For debugging in case you need it
        '--disable-dev-shm-usage', // Helps with memory issues
        '--single-process'
      ],
    });
    const page = await browser.newPage();
    await page.setContent(htmlContent, { waitUntil: 'domcontentloaded' });

    // Wait for the chart to render fully
    await page.waitForSelector('#container', { visible: true });
    await new Promise(resolve => setTimeout(resolve, 5000)); // Adjust the time as needed

    // Define the header and footer templates
    const headerTemplate = `<div style="text-align: center; margin-top: -20px;">
               <img style="max-width: 100%; height: 20%;" src="data:image/png;base64,">
         </div>
        `;
    // const headerTemplate = `<div><img src="https://iili.io/2NGjMI2.png"></div>`;
    const footerTemplate = `
        <div style="position: absolute; bottom: 0; width: 100%; height: auto;">
         <img style="max-width: 100%; height: auto;" src="data:image/png;base64,">
        </div>
        `;
    console.log("set pdfBuffer");
    const pdfBuffer = await page.pdf({
      format: 'A4',
      printBackground: true,
      displayHeaderFooter: true,
      headerTemplate,
      footerTemplate,
      margin: {
        top: "160px",    // Adjust this to give space for the header
        bottom: "80px",
        right: "0px",
        left: "0px"
      }
    });

    await browser.close();

    const pdfPath = path.join(__dirname, 'tmp', `${student.studentData.fullName}_${student.studentData.rollNo}_${student.examData.examName}.pdf`);

    fs.writeFileSync(pdfPath, pdfBuffer);

    console.log(`PDF generated for ${studentReportId}`);

    res.download(pdfPath, `${student.studentData.fullName}_${student.studentData.rollNo}_${student.examData.examName}.pdf`, (err) => {
      if (err) {
        console.error('Error downloading the file:', err);
        // res.status(500).send('Error downloading the file.');
        if (!res.headersSent) {
          return res.status(500).send('Error downloading the file.');
        }
      } else {
        // After download, delete the file
        fs.unlink(pdfPath, (unlinkErr) => {
          if (unlinkErr) {
            console.error('Error deleting the file after download:', unlinkErr);
          }
        });
      }
    });
  } catch (error) {
    console.error('Error generating PDF:', error);
    if (!res.headersSent) {
      return res.status(500).send('Failed to generate PDF');
    }
  }
});

